import React from 'react';
import ReactDOM from 'react-dom';
import Dice from './Dice';

const App: React.FC = () => {
  return (
    <div>
      <h1>Random Dice Roller</h1>
      <Dice numDice={5} />
    </div>
  );
};

ReactDOM.render(<App />, document.getElementById('root'));
